import React from "react";
import "./Data.css";
import Item from "./Item/Item";

const Data = (props) => {
	return (
		<div className="data">
			<div className="data_type">Programming languages</div>
			<table>
				<tbody>
					{props.data.map((item) => (
						// <Item item={item} key={item.name} />
						<tr className={classes.join(" ")}>
							<td className="item_name">{props.item.name}</td>
						</tr>
					))}
				</tbody>
			</table>
		</div>
	);
};

export default Data;
